import{_ as t,o as d,c as C,R as r}from"./chunks/framework.S1SDgkSw.js";const F=JSON.parse('{"title":"组件清单（1-20）","description":"","frontmatter":{"title":"组件清单（1-20）","date":"2021-07-07T18:29:46.000Z"},"headers":[],"relativePath":"doc/wpdoc/组件清单（1-20）.md","filePath":"doc/wpdoc/组件清单（1-20）.md"}'),a={name:"doc/wpdoc/组件清单（1-20）.md"},e=r('<h1 id="组件清单-1-20" tabindex="-1">组件清单（1-20） <a class="header-anchor" href="#组件清单-1-20" aria-label="Permalink to &quot;组件清单（1-20）&quot;">​</a></h1><table><thead><tr><th>序号</th><th>组件编码</th><th>组件名称</th><th>组件类型</th><th>所属行业</th><th>产品分类</th><th>应用端</th><th>应用客户</th><th>业务用途</th><th>设计人员</th></tr></thead><tbody><tr><td>1</td><td>COM-BC001-FC001</td><td>苹果端ABM分发</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>益海嘉里</td><td>帮助项目快速部署苹果应用APP程序包，无需经过苹果繁琐的上架审核，解决项目没有企业证书又急需部署应用等问题。组件价值：1.通过该组件，企业发布的苹果APP，可自定义APP LOGO、应用名称。2.通过该组件，企业可以同时发布多个APP版本，而不受苹果限制。3.通过该组件，企业紧急Fix发布APP，不需要等待苹果公司上架审核。</td><td>周涛</td></tr><tr><td>2</td><td>COM-BC002-FC001</td><td>流程图自动绘制</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>无</td><td>1.流程图规范，实现工具自动化，避免人为低级错误发生。2.流程图绘制，能够一键输出，形成统一风格、统一标准。3.聚焦于业务，无需手工低效绘制繁琐的流程图。4.简单且高效，按照模板格式，填写必填字段后，1秒内生成流程图，平均节省至上30分钟/流程绘制。</td><td>韦长英</td></tr><tr><td>3</td><td>COM-BC003-FC001</td><td>富文本套打打印</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>红牛</td><td>富文本套打适用于电子协议签约后需保存相关协议图片的企业，且图片时有不全，白图或者图片丢失的场景。目前富文本套打支持生成png图片以及pdf文件两种格式，暂无其他格式生成选项。</td><td>黄国荣</td></tr><tr><td>4</td><td>COM-BC004-FC001</td><td>在途流程交接</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>红牛</td><td>在途流程交接适用于审批人离职，在其审批节点下的审批流程无法处理，或由于特殊原因导致中途审批人员无法处理或其他原因操作不到等场景。其价值包括：1.保证整个流程处理的完整性2. 一次处理对应发起人提交流程，审批人无法处理的流程数据，进行交接处理3. 适用于企业所有流程数据</td><td>曾小兵</td></tr><tr><td>5</td><td>COM-BC005-FC001</td><td>地址自动获取行政区域</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>全端</td><td>景田</td><td>在APP端和WEB端新增终端基础信息时，设置了终端地址后，根据地址自动带出行政区域，而不需要手动再去设置行政区域，简化了用户的操作</td><td>梁坚鹏</td></tr><tr><td>6</td><td>COM-BC012-FC001</td><td>行政区域管理</td><td>业务和功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>有友</td><td>对于SFA系统而言，行政区域是很常用的功能，终端需要关联行政区域，经销商需要关联行政区域，及其他功能也可能需要关联行政区域。但由于行政区域变化比较块，需要一个通用的维护行政区域的功能。</td><td>陈壬询</td></tr><tr><td>7</td><td>COM-BC013-FC001</td><td>企业微信推送消息</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>接口</td><td>景田</td><td>实现aPaas平台发送消息推送到企业微信用户，如TPM新增方案，方案的审批可推送到企业微信进行</td><td>刘嘉豪</td></tr><tr><td>8</td><td>COM-BC007-FC001</td><td>标准化上线流程</td><td>业务组件</td><td>通用/通用组件</td><td>COM</td><td>全端</td><td>好来化工</td><td>以好来化工项目的整个上线到生产的过程为蓝本，详细的分析记录了准备阶段、实施阶段、验证阶段各个相关的团队需要完成的工作任务及过程资料，制定了标准化的上线流程指引。</td><td>吴美冬</td></tr><tr><td>9</td><td>COM-BC008-FC001</td><td>通用AI数据抽取、转换、业务化流程</td><td>业务组件</td><td>通用/通用组件</td><td>COM</td><td>全端</td><td>好来化工</td><td>本流程以好来化工项目AI实施落地为蓝本，完整阐述了AI数据如何抽取、如何进行数据处理、如何与业务流程关联。能够有效的指导工程师进行AI项目的实施</td><td>吴美冬</td></tr><tr><td>10</td><td>COM-BC015-FC001</td><td>权限规则性能优化</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>全端</td><td>红牛</td><td>通过组合权限的方式，避免由权限拼接产生的查询问题，提升数据查询效率，提高用户使用系统过程中的友好体验感，减少系统卡顿及崩溃无法使用；响应优化速度快，平均耗时3~5秒。</td><td>黄国荣</td></tr><tr><td>11</td><td>COM-BC011-FC001</td><td>AI离线识别</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>APP</td><td>好来化工</td><td>AI离线识别，其实应该说是AI延迟识别，网络不好时，图片会先保存到本地，当网络好时，拍照记录会通过离线队列生成到数据库，然后我们就需要找到未识别的记录，然后通过后台调度去调用AI对应的识别结果，以得到对应的结果</td><td>颜升</td></tr><tr><td>12</td><td>COM-BC016-FC001</td><td>小程序权限配置组件</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>纳爱斯</td><td>通过小程序登录系统，获取后台小程序权限配置勾选项，再”生成器”的作用下，生成功能点权限树；支持管理员通过不同岗位不同职位不同角色，通过apaas后台权限配置，动态地随时地实时地去控制小程序功能点的权限。</td><td>黄日雄</td></tr><tr><td>13</td><td>COM-BC006-FC001</td><td>基于apaas平台word&amp;excel设置的套打</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>三纤</td><td>多用于客户线下纸质流程的报价单，合同归档以及审批的数据集采</td><td>翟球球</td></tr><tr><td>14</td><td>COM-BC017-FC001</td><td>调度报错通知配置</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>接口</td><td>纳爱斯</td><td>对于现在的一些系统业务，经常需要在半夜凌晨通过调度的方式执行业务数据的更新或者删除，因此需要一个通知配置结合短信的方式（甚至可以结合微信或者企业微信），能够让客户的管理员第一时间接收到调度服务的异常提醒，第一时间联系到实施人员进行异常的定位以及及时的干预，从而更好的继续开展业务</td><td>范伟健</td></tr><tr><td>15</td><td>COM-BC020-FC001</td><td>小程序码</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>接口</td><td>王老吉</td><td>该组件用于获取微信小程序token和微信小程序码，旨在解决微信小程序token每天只能获取2000次的上限问题，以及动态获取微信小程序码</td><td>蒲开封</td></tr><tr><td>16</td><td>COM-BC019-FC001</td><td>项目更新现有最新行政区域</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>接口</td><td>景田</td><td>该组件用于更新已上线使用，存在基础数据的系统中，更新最新的行政区域，并且更新现有基本数据的行政区域，例如终端等，不影响原有数据的前提下更新成最新行政区域，并会更新地图数据</td><td>梁坚鹏</td></tr><tr><td>17</td><td>COM-BC022-FC001</td><td>小程序订阅消息推送</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>接口</td><td>朝云</td><td>组件用于小程序订阅消息，后台调度推送消息，目前应用在朝云项目</td><td>丁泽雄</td></tr><tr><td>18</td><td>COM-BC016-FC002</td><td>小程序权限配置组件2.0</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>WEB</td><td>纳爱斯</td><td>通过小程序登录apaas系统，获取后台小程序权限配置勾选项。并加载小程序的导航栏内容，通过小程序导航栏内容比对小程序权限配置，实现配置小程序功能权限效果</td><td>黄日雄</td></tr><tr><td>19</td><td>COM-BC021-FC001</td><td>H5数据收集提交组件</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>接口</td><td>养元</td><td>通过分享到微信的二维码，收集相关扫码人的基本信息；用于促销员登记等业务场景</td><td>杨荣</td></tr><tr><td>20</td><td>COM-BC003-FC001</td><td>富文本套打打印2.0</td><td>功能组件</td><td>通用/通用组件</td><td>COM</td><td>接口</td><td>红牛</td><td>通用组件配置清单，在1.0基础上进行组件使用优化 1、整合富文本管理UI，2、精简逻辑和设置界面，3、去除冗余代码及功能，降低使用难度，4、附带增加richtext 维护的功能模块，以便没有富文本功能的项目也能导入使用</td><td>黄国荣</td></tr></tbody></table>',2),O=[e];function M(o,h,_,B,c,s){return d(),C("div",null,O)}const P=t(a,[["render",M]]);export{F as __pageData,P as default};
